namespace Unlimitedinf.Fileserve
{
    using System;

    internal static class Icon
    {
        internal const string UnlimitedInf = "";

        private static byte[] asBytes = null;
        internal static byte[] Favicon
        {
            get
            {
                if (asBytes == null)
                    asBytes = Convert.FromBase64String(Icon.UnlimitedInf);
                return asBytes;
            }
        }
    }
}
